import './App.css';
import HeroImage from "./pictures/MagdaHero.jpg"// with import
import {Parallax,ParallaxLayer} from '@react-spring/parallax'
import { useTrail,animated } from '@react-spring/web';


function App() {
  return (
    <Parallax pages={2} className=" bg-moon-mist-100">
          <ParallaxLayer className="flex items-center justify-center" speed={2} offset={0}>

              <HeroText></HeroText>

          </ParallaxLayer>

          <ParallaxLayer offset={0.99} speed={2}>

              <AboutMe></AboutMe>

          </ParallaxLayer>

          <ParallaxLayer sticky={{start:0.999,end:0.999}} speed={1} >
            <div className="flex items-center justify-evenly content-center">
                  <HeroImageDisplay></HeroImageDisplay>
             </div>

           </ParallaxLayer>



    </Parallax>
  );

}
function NavBar(){
      return(
        <div>
          <nav>

          </nav>
        </div>
      )
}


function HeroImageDisplay(){
  const [trails, api] = useTrail(1, () => ({
    from: { opacity: 0 },
    to: { opacity: 1 },
    config: { mass: 1, tension: 200, friction: 150 }
  }));

        return(
          <div>
          {trails.map(()=>(
            <animated.div>

              <div className=" bg-buttercup-400 rounded-full p-2">
                  <img src={HeroImage} className="w-56 h-auto rounded-full" alt="HeroImage"></img>
              </div>

            </animated.div>

            )
          )
          }
          </div>
        )

}
function Projects(){
return(
  <div className='m-10'>
    <h1 className="text-6xl text-botticelli-400 font-Fraunces text-center">Projects</h1>
      <br></br>
    <ul className="text-4xl text-botticelli-400 font-Fraunces text-center">
      <li>Amsterdam</li>
      <li>Utrecht</li>
      <li>Prague</li>
      <li>Copenhagen</li>
    </ul>
  </div>
)
}

function AboutMe(){
  return(
  <div className='w-56'>
    <h1>About Me</h1>
    <p>
    Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.
    </p>
  </div>
  )
}

  function HeroText() {
    const [trails] = useTrail(1, () => ({
      from: { opacity: 0 },
      to: { opacity: 1 },
      config: { mass: 1, tension: 200, friction: 150 }
    }));

    return (
      <div>
        {trails.map((props) => (
          <animated.div style={props} className=" text-gun-powder-950 text-[12rem] text-center font-CormorantGaramond">
            Magda Nemes
          </animated.div>
        ))}
      </div>
    );
  }





export default App;
